import React from 'react';
import { navigationLinkAbout } from "../../styles/Navigation.scss"


const NavigationLinkAbout = props => {
    return (
        <div
            className="navigationLinkAbout"
            id="idNavLinkAbout"
        >
            <div>
                {props.aboutLink}
            </div>
        </div>
    )
}

export default NavigationLinkAbout
